
class Solution:
    # two pointer
    def minWindow(self, S, T):
        res = ""
        start = -1
        while True:
            first = start + 1                   # start from S[0]
            for c in T:                         # find if c exists from S[start:len(S)]
                start = S.find(c, start + 1)
                if start == -1: return res      # no more feasible solutions, return res
            
            start = end = start + 1             # lets focus on S[:end]
            for c in reversed(T):               # keep push start to the left side
                start = S.rfind(c, first, start)
            
            if res == "" or len(res) > end - start:     # update the better answer
                res = S[start:end]
    
    # DP
    # dp[i][j] stores the starting index of of T[:i] and S[:j]
    # if T[i] == S[j]: dp[i][j] == dp[i-1][j-1]
    # else: dp[i][j] == dp[i][j-1] (if exist)

    def minWindow_DP(self, S, T):
        M, N = len(T), len(S)
        dp = [[0 for _ in range(N+1)] for _ in range(M+1)]
        for j in range(N+1):
            dp[0][j] = j+1
        
        for i in range(1,M+1):
            for j in range(1,N+1):
                if T[i-1] == S[j-1]:
                    dp[i][j] = dp[i-1][j-1]
                else:
                    dp[i][j] = dp[i][j-1]
        
        start, minLen = 0, N+1
        for j in range(1,N+1):
            if dp[M][j] != 0:
                if j - dp[M][j] + 1 < minLen:           # update the answer
                    start, minLen = dp[M][j]-1, j-dp[M][j]+1

        return S[start:start+minLen] if minLen != N+1 else ""

